import "./App.css";
import Formbuild from "./formbuild";
import DataCreator from "./dataCreator";
import { useState } from "react";
function App() {
  const [questionListHai , setQuestionListHai] = useState([])
  return (
    <div className="App">
      <DataCreator questionListHai={questionListHai} setQuestionListHai={setQuestionListHai}/>
      <Formbuild />
    </div>
  );
}

export default App;
